//  Error Messege Setting

private enum AppSuitError: Error {

    case AppSuit_Success(message: String = "[STEALIEN] 정상")

    case AppSuit_AppID(message: String = "[STEALIEN] 앱 아이디 초기화 필요")

    case AppSuit_Debug(message: String = "[STEALIEN] 디버깅 탐지")

    case AppSuit_Jailbreak(message: String = "[STEALIEN] 탈옥 탐지")

    case AppSuit_Integrity(message: String = "[STEALIEN] 위변조 탐지")

    case AppSuit_Threat(message: String = "[STEALIEN] 위협 탐지")

}

//  MARK: - Error Title & Messege Define

extension AppSuitError: LocalizedError {

    //  Error Title Setting
    var errorDescription: String? {
        switch self {

        case .AppSuit_Success(message: _):
            return "[STEALIEN] 정상"

        case .AppSuit_AppID(message: _):
            return "[STEALIEN] FFFF"

        case .AppSuit_Debug(message: _):
            return "[STEALIEN] 1000"

        case .AppSuit_Jailbreak(message: _):
            return "[STEALIEN] 1100"

        case .AppSuit_Integrity(message: _):
            return "[STEALIEN] 1200"

        case .AppSuit_Threat(message: _):
            return "[STEALIEN] 1300"

        }
    }

    //  Error Messege
    var recoverySuggestion: String? {
        switch self {

        case .AppSuit_Success(message: let message):
            return message

        case .AppSuit_AppID(message: let message):
            return message

        case .AppSuit_Debug(message: let message):
            return message

        case .AppSuit_Jailbreak(message: let message):
            return message

        case .AppSuit_Integrity(message: let message):
            return message

        case .AppSuit_Threat(message: let message):
            return message
        }
    }

}

//  MARK: - Localized Alert Error

struct LocalizedAlertError: LocalizedError {
    let underlyingError: LocalizedError

    var errorDescription: String? {
        underlyingError.errorDescription
    }

    var recoverySuggestion: String? {
        underlyingError.recoverySuggestion
    }

    init?(error: Error?) {
        guard let localizedError = error as? LocalizedError else { return nil }
        underlyingError = localizedError
    }
}

